function Footer(props) {
  return ( 
    <footer>
      <h3><FontAwesomeIcon icon={faSpinner} color="blue" spin/></h3>
      <h3><FontAwesomeIcon icon={faCircleNotch} color="red" spin/></h3>
      <span>Copyright &copy;</span>
      <span>{`${new Date().getFullYear()}`}</span>
      <a href="https://github.com/hosja83" rel="noopener noreferrer" target="_blank">Alhosainy Altaher</a>
      <a href="https://github.com/hosja83" rel="noopener noreferrer" target="_blank"></a>
    </footer>
   );
}

export default Footer;
